use std::io::Read;
use std::collections::HashMap;
use std::cmp::min;

fn main() {
    let mut buf = String::new();
    std::io::stdin().read_to_string(&mut buf).unwrap();

    let answer = solve(&buf);

    println!("{}", answer);
}

fn solve(input: &str) -> String {
    let mut iterator = input.split_whitespace();

    let n: usize = iterator.next().unwrap().parse().unwrap();

    let mut counts_b: HashMap<usize, usize> = HashMap::new();
    let mut counts_c: HashMap<usize, usize> = HashMap::new();
    for i in 0..n {
        let ai = iterator.next().unwrap().parse().unwrap();
        if i % 2 == 0 {
            *counts_b.entry(ai).or_insert(0) += 1;
        } else {
            *counts_c.entry(ai).or_insert(0) += 1;
        }
    }

    let mut b = 0;
    let mut max_count_b = 0;
    for (&x, &count) in counts_b.iter() {
        if count > max_count_b {
            b = x;
            max_count_b = count;
        }
    }

    let mut c = 0;
    let mut max_count_c = 0;
    for (&x, &count) in counts_c.iter() {
        if count > max_count_c {
            c = x;
            max_count_c = count;
        }
    }

    if b != c {
        let ans = n - max_count_b - max_count_c;
        return ans.to_string();
    }

    let mut second_max_count_b = 0;
    for (&x, &count) in counts_b.iter() {
        if x == b {
            continue;
        }
        if count > second_max_count_b {
            second_max_count_b = count;
        }
    }

    let mut second_max_count_c = 0;
    for (&x, &count) in counts_c.iter() {
        if x == c {
            continue;
        }
        if count > second_max_count_c {
            second_max_count_c = count;
        }
    }

    let ans = min(
        n - second_max_count_b - max_count_c,
        n - max_count_b - second_max_count_c
    );

    return ans.to_string();
}

